import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPage = () => {
  const [birds, setBirds] = useState([]);
  const [cats, setCats] = useState([]);
  const [dogs, setDogs] = useState([]);

  useEffect(() => {
    // Fetch data from APIs
    const fetchBirds = axios.get('http://localhost:3000/api/birds');
    const fetchCats = axios.get('http://localhost:3000/api/cats');
    const fetchDogs = axios.get('http://localhost:3000/api/dogs');

    // Execute all requests concurrently
    axios.all([fetchBirds, fetchCats, fetchDogs])
      .then(axios.spread((birdsRes, catsRes, dogsRes) => {
        // Set state with fetched data
        setBirds(birdsRes.data);
        setCats(catsRes.data);
        setDogs(dogsRes.data);
      }))
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Admin Page</h1>
      <h2>Birds</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Color</th>
          </tr>
        </thead>
        <tbody>
          {birds.map(bird => (
            <tr key={bird.id}>
              <td>{bird.name}</td>
              <td>{bird.color}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Cats</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Breed</th>
          </tr>
        </thead>
        <tbody>
          {cats.map(cat => (
            <tr key={cat.id}>
              <td>{cat.name}</td>
              <td>{cat.breed}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Dogs</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Breed</th>
          </tr>
        </thead>
        <tbody>
          {dogs.map(dog => (
            <tr key={dog.id}>
              <td>{dog.name}</td>
              <td>{dog.breed}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminPage;
